import { BrowserRouter, Routes, Route } from 'react-router-dom'
import HomePage from './pages/HomePage/HomePage';
import './App.scss';

function App() {
  return (
    <>
      <BrowserRouter>
        <Routes>
          <Route path='/' to={HomePage} />
        </Routes>
      </BrowserRouter>
      <HomePage />
    </>
  );
}

export default App;
